import React from "react";
import ReactDom from "react-dom";
import './index.css';

const name="Revati";
const img1="https://picsum.photos/250/300";
const img2="https://picsum.photos/251/300";
const img3="https://picsum.photos/252/300";

ReactDom.render(
    <React.Fragment>
     <h1 className="heading">Hello, my name is {name}!</h1> 
     <div className="mydiv">

     <img src={img1} alt="Lorem img"/>
     <img src={img2} alt="Lorem img"/>
     <img src={img3} alt="Lorem img"/>
     </div>



    </React.Fragment>
    ,document.getElementById('root'));
